Consider a scenario where you are copying a large file, and you want to update the user interface (e.g., a progress bar) as each chunk of the file is copied. Co-routines can be used to yield control after each chunk is copied, allowing the UI to update: local function copyFile(source, destination) local input = io.open(source, "rb") local output = io.open(destination, "wb") while true do local chunk = input:read(1024) if not chunk then break end output:write(chunk) coroutine.yield() -- Yield after writing each chunk end input:close() output:close()
end local routine = coroutine.create(copyFile)
coroutine.resume(routine) -- Start the copy process In this example, the copy operation is split into chunks, and the co-routine yields after writing each chunk. This allows for periodic updates to the UI or other tasks to be performed between chunks.

